import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router , Route , Switch } from 'react-router-dom'
import CalendarScreen from '../components/Calendar';

function App() {
  return (
   <Router>
    <Switch>
      <Route path='/' exact component={CalendarScreen} />
    </Switch>
   </Router>
  );
}

export default App;
